import React from 'react'

class Result extends React.Component {
  constructor(props) {
    super(props)

    this.state = {
      stag:[5, 2, 2, 2],
      otter:[3, 1, 3, 3],
      doe:[2, 2, 2, 2],
      phoenix:[3, 4, 1, 3],
      wolf:[5, 5, 3, 2],
      cat:[5, 2, 5, 5],
      horse:[5, 3, 5, 1]
    }
    this.renderResults = this.renderResults.bind(this)
  }

  renderResults() {
    let {stag, otter, doe, phoenix, wolf, cat, horse} = ''
    let userScore = this.props.userScore
    stag = this.state.stag.map(function(item, index) {
        return Math.abs(item) - Math.abs(userScore[index])
    })
    console.log(stag)
  }

  render() {
    return(
      <h3>{this.props.userScore}  {this.renderResults()}</h3>
    )
  }
}

export default Result
